import Navbar from "./components/Navbar"
import Main from "./components/Main"

export default function App() {
    const [darkMode, setDarkMode] = React.useState(false)

    return (
        <div className="container">
            <Navbar 
                darkMode={darkMode}
            />
            <Main 
                darkMode={darkMode}
                toggleDarkMode={toggleDarkMode}
            />
        </div>
    )
}
